def newMember(order, tau, N_samples=1):
    # this has errored on the supercomputer, but I have no idea why
    try:
        te_gap_lookup = {
            '15':  0.00196,
            '18':  0.00230,
            '21':  0.00262,
            '24':  0.00751,
            '27':  0.01012,
            '30':  0.01828,
            '33':  0.02644,
            '36':  0.02896,
        }

        indicies = list(sorted(random.sample(range(0, len(possible_members)), N_samples)))
        
        opt = []
        for ix in indicies:
            afl = Kulfan(TE_gap = te_gap_lookup[str(int(100*tau))])
            afl.upperCoefficients = possible_members[ix][0:8]
            afl.lowerCoefficients = possible_members[ix][8:]
            afl.scaleThickness(tau)
            afl.changeOrder(order)
            K_candidate = afl.upperCoefficients.magnitude.tolist() + afl.lowerCoefficients.magnitude.tolist()

            opt.append([K_candidate])

        if N_samples == 1:  
            return opt[0]
        else:
            return opt
    except:
        # return a flat plate, will fail almost all constraints
        if N_samples == 1:
            return [[0.0] * order * 2]
        else:
            return [[0.0] * order * 2] * N_samples

if __name__ == "__main__":
    print(newMember(4,0.15,3))
